import React, { useContext } from "react";
import { ListingContext } from "../Context";

function ListingDetail() {
    const { contextDetail } = useContext(ListingContext);
    const [detail, setDetail] = contextDetail;

    return (
        <div>
            <h1>{detail.title}</h1>
        </div>
    )
}

export default ListingDetail;
